import './App.css';

export default function Faq(){
    return(
<div className="about-page">
      <h2 className="about-heading">About MovieLand</h2>
      <h2>What tools did we use to build the project?</h2>
      <p className='about-paragraph'>We use ReactJS to write our websites with the help of AWS Amplify to host it on public</p>

     <h2>Where did we retrive the movie information from?</h2>
      <p className='about-paragraph'>We use an API key to access OMDB database that is already available on public and then display it on our website</p>
     
     <h2>What is the purpose of our website?</h2>
      <p className='about-paragraph'>
        Our purpose is for the user to be able to find their movies quick and simple
      </p >
    </div>


    )

}
